window.bookSummaryJSON = "<p>In the captivating start to a new, darkly lyrical fantasy series, Tea can raise the dead, but resurrection comes at a price. </p> <p>When Tea accidentally resurrects her brother from the dead, she learns she is different from the other witches in her family. Her gift for necromancy means that she's a bone witch, a title that makes her feared and ostracized by her community. But Tea finds solace and guidance with an older, wiser bone witch, who takes Tea and her brother to another land for training. </p> <p>In her new home, Tea puts all her energy into becoming an asha - one who can wield elemental magic. But dark forces are approaching quickly, and in the face of danger, Tea will have to overcome her obstacles and make a powerful choice. </p>"; 
